import React, { Component } from "react";
import { graphql } from "react-apollo";
import { deleteProduct } from "../queries/queries";
import Button from "@material-ui/core/Button";

class DeleteProduct extends Component {
  render() {
    return (
      <div>
        <Button
          variant="contained"
          color="secondary"
          onClick={() => deleteProduct(this.props.id)}
        >
          Удалить
        </Button>
      </div>
    );
  }
}

export default graphql(deleteProduct)(DeleteProduct);
